 de soporte%2$s. Error:  Petición a la API impropia.','Oops! We ran into a problem. Please try again in a few minutes. If the issue persists please %1$scontact our support%2$s team. Error: API returned a %3$s%4$d: %5$s%6$s'=>'¡Vaya! Nos encontramos con un problema. Por favor, inténtalo de nuevo en unos minutos. Si el problema persiste, %1$scontacta con nuestro equipo de soporte%2$s. Error: La API ha devuelto un %3$s%4$d: %5$s%6$s','Oops! We ran into a problem. Please try again in a few minutes. If the issue persists please %1$scontact our support%2$s team. Error: API returned a %3$s%4$s%5$s response.'=>'¡Vaya! Hemos tenido un problema. Por favor, inténtalo de nuevo en unos minutos. Si el problema persiste, por favor %1$scontacta a nuestro equipo de soporte%2$s. Error: La API ha devuelto una respuesta %3$s%4$s%5$s.','Oops! We encountered an error. Please wait a few minutes and try again. If the issue persists, please %1$scontact our support%2$s team.'=>'¡Vaya! Hemos encontrado un problema. Por favor, espera unos minutos e inténtalo de nuevo. Si el problema persiste, por favor %1$scontacta con nuestro equipo de soporte%2$s.','You must be properly authenticated with MonsterInsights to use our reports. Please use our %1$ssetup wizard%2$s to get started.'=>'Debes estar identificado correctamente con MonsterInsights para utilizar nuestros informes. Utiliza nuestro %1$sasistente de configuración%2$s para empezar.','Oops! It appears as though you do not have the right user permissions to authenticate. Please contact your website administrator to check your user roles.'=>'¡Vaya! Parece que no tienes los permisos de usuario adecuados para identificarte. Ponte en contacto con el administrador de tu web para comprobar tu perfil de usuario.','Oops! We did not find a properly authenticated analytics account. Please %1$sauthenticate with Google%2$s to allow MonsterInsights to show you reports.'=>'¡Vaya! No hemos encontrado una cuenta de análisis correctamente identificada. Por favor, %1$sidentifícate con Google%2$s para permitir que MonsterInsights te muestre los informes.','Oops! We did not find an active MonsterInsights license. Please %1$scheck your license settings%2$s or %3$scontact our support team%4$s for help.'=>'¡Vaya! No encontramos una licencia activa de MonsterInsights. Por favor, %1$scomprueba los ajustes de tu licencia%2$s o %3$scomunícate con nuestro equipo de soporte%4$s para obtener ayuda.','Oops! The MonsterInsights dashboard has been disabled. Please check with your site administrator that your role is included in the MonsterInsights permissions settings. %1$sClick here for more information%2$s.'=>'¡Vaya! El escritorio de MonsterInsights ha sido desactivadoPor favor, comprueba con el administrador de tu sitio que tu perfil está incluido en los ajustes de permisos de MonsterInsights. %1$sHaz clic aquí para más información%2$s.','Oops! Access is denied. If you believe you should be able to view this report, please contact your website administrator to ensure you have the correct user role to view MonsterInsights reports.'=>'¡Vaya! El acceso está denegado. Si crees que deberías poder ver este informe, ponte en contacto con el administrador de tu web para asegurarte de que tiene el perfil de usuario correcto para ver los informes de MonsterInsights.','There was an error installing the addon, %1$s. Please try again. If you are still having issues, please %2$scontact our support%3$s team. '=>'Hubo un error al instalar la extensión, %1$s. Por favor, inténtalo de nuevo. Si sigue teniendo problemas, por favor %2$scontacta con nuestro equipo de soporte%3$s. ','There was an error installing the addon. Please try again. If you are still having issues, please %1$scontact our support%2$s team.'=>'Se ha producido un error al instalar la extensión. Por favor, inténtalo de nuevo. Si sigues teniendo problemas, por favor %1$scontacta con nuestro equipo de soporte%2$s.','Oops! There has been an error while trying to deauthenticate. Please try