r 1000+ form templates. Trusted by over 6 million websites as the best forms plugin.'=>'El mejor maquetador de formularios de WordPress de arrastrar y soltar. Crea fácilmente hermosos formularios de contacto, encuestas, formularios de pago y más con nuestras más de 1000 plantillas de formulario. Más de 6 millones de webs lo confían como el mejor plugin de formularios.','To update, we recommend following this %1$sstep by step guide for updating WordPress%2$s from IsItWP and afterwards check out %3$sWhy You Should Always Use the Latest Version of WordPress%4$s on WPBeginner.'=>'Para actualizar, recomendamos seguir esta %1$sguía detallada para actualizar WordPress%2$s desde IsItWP y después echa un vistazo a%3$sPor qué siempre debes usar la última versión de WordPress?%4$s en WPBeginner.','The good news: updating WordPress has never been easier and only takes a few moments.'=>'La buena noticia: actualizar WordPress nunca ha sido tan fácil y sólo toma unos momentos.','In the next major release of MonsterInsights we are planning to remove support for the version of WordPress you are using (version %s). This version is several years out of date, and most plugins do not support this version anymore, so you could be missing out on critical updates for performance and security already!'=>'En la próxima versión importante de MonsterInsights estamos planeando eliminar el soporte para la versión de WordPress que estás usando (versión %s). Esta versión está varios años desactualizado, y la mayoría de los plugins ya no son compatibles con esta versión, por lo que te podrías estar perdiendo actualizaciones críticas para el rendimiento y la seguridad.','ACTION REQUIRED: Your WordPress version is putting your site at risk!'=>'ACCIÓN OBLIGATORIA: ¡La versión de WordPress que tienes está poniendo tu sitio en serio riesgo!','Upgrading your PHP version will make sure you are able to continue using WordPress without issues in the future, keep your site secure, and will also make your website up to 400% faster!'=>'Actualizar la versión de PHP te asegura de que puedes de seguir usando WordPress sin problemas en el futuro, mantener tu sitio seguro, y también hará que su sitio web ¡hasta un 400% más rápido!','To ensure MonsterInsights and other plugins on your site continue to function properly, and avoid putting your site at risk, please take a few minutes to ask your website hosting provider to upgrade the version of PHP to a modern PHP version (7.2 or newer). We provide helpful templates for how to ask them %1$shere%2$s.'=>'Para asegurarse de que MonsterInsights y otros plugins del sitio siguen funcionando correctamente, y para evitar poner tu sitio en riesgo, por favor invierte unos minutos en pedirle a tu proveedor de alojamiento que actualice la versión de PHP a una versión moderna (7.2 o más reciente). Tenemos algunas plantillas de cómo pedírselo %1$saquí%2$s.','In the next major release of MonsterInsights we are planning to remove support for the version of PHP you are using (%s). This insecure version is no longer supported by WordPress itself, so you are already missing out on the latest features of WordPress along with critical updates for security and performance (modern PHP versions make websites much faster).'=>'Para la próxima versión de MonsterInsights estamos planeando eliminar el soporte para la versión de PHP que estás utilizando (%s). Esta versión es insegura y no es compatible con WordPress, por lo que ya te estás perdiendo las últimas funcionalidades de WordPress, además de las actualizaciones críticas para la seguridad y el rendimiento (las versiones modernas de PHP hacen que los sitios web sean mucho más rápidos).','ACTION REQUIRED: Speed your website up 400% with a single email!'=>'ACCION OBLIGATORIA: ¡Acelera tu sitio web un 400% con un solo correo electrónico!','ACTION REQUIRED: Your PHP version is putting your site at risk!'=>'ACTION REQUERIDO: ¡La versión de PHP está poniendo tu sitio en riesgo!','There was an error grabbin