o para tu audiencia, podrías obtener grandes aumentos en las visitas a la página, el tiempo invertido en la página y una tasa de rebote reducida.<br><br>Si necesitas ayuda para elegir un plugin de traducción para comenzar, echa un vistazo a %1$sseste artículo%2$s para conocer las mejores opciones disponibles.','%1$s%% of Your Audience is From %2$s'=>'%1$s%% de tu audiencia es de %2$s','Try the Headline Analyzer to Boost Your Clicks & Traffic'=>'Prueba el analizador de titulares para aumentar tus clics y tu tráfico','Add File Extensions'=>'Añadir extensiones de archivo','By default, MonsterInsights automatically tracks downloads of the following file extensions: doc, pdf, ppt, zip, xls, docx, pptx, and xlsx. You can easily add or remove extensions from that list in the %1$sEngagement settings%2$s of MonsterInsights.<br><br> You can view your Top Downloads report directly in the MonsterInsights %3$sPublishers report%4$s.'=>'Por defecto, MonsterInsights hace seguimiento automático de las descargas de las siguientes extensiones de archivo: doc, pdf, ppt, zip, xls, docx, pptx y xlsx. Puedes añadir o eliminar fácilmente extensiones de esa lista en los %1$sAjustes de interacción%2$s de MonsterInsights.<br><br> Puedes ver tu informe de descargas principales directamente en el informe de editores%3$s%4$s de MonsterInsights.','By upgrading to MonsterInsights Pro you get access to additional reports right in your WordPress dashboard and advanced tracking features like eCommerce, Custom Dimensions, Forms tracking and more!'=>'Al actualizar a MonsterInsights Pro, obtienes acceso a informes adicionales directamente en tu escritorio de WordPress y funciones avanzadas de seguimiento de comercio electrónico, dimensiones personalizadas, seguimiento de formularios y ¡mucho más!','Only %s%% of Your Visitors Return to Your Site'=>'Solo el %s%% de tus visitantes vuelven a tu sitio','Read More'=>'Leer más','By tracking your affiliate links in Google Analytics, you can gather all the data 